import { Icon } from '@iconify/react';
import { pageTitle } from '../../../helper';
import Div from '../../Div';
import Spacing from '../../Spacing';
import React ,{useState , useContext , useEffect} from 'react'
import axios from 'axios'
import {useParams} from 'react-router-dom'
import Users from './user';
import {GlobalState} from '../../../GlobalState'

const initialeState ={
    username:'',
    email:'',
    password:'',
    role:'',
    _id : ''
  }

function UpdateUser() {
    useEffect(()=>{
        if(param.id){
            setOnEdit(true)
            User.forEach(user => {
                if(user._id === param.id) {
                    setO(off)
                    setImages(off.img)
                }
            });
           
        }else{
            setOffer(initialeState)
            setImages('')
            setOnEdit(false)
        }
    },[param.id , offers])

    
    
    
    
    
    const HandleChangeInput = e =>{
        const {name , value} = e.target
        setUser({...User , [name]:value})
    }

    const HandleSubmit = async e =>{
        e.preventDefault()
        try {
           if(!isAdmin) return alert("vous n'Ã©tes pas un admin.")
           if(onEdit){
               await axios.put(`/user/updateUser//${Users._id}` , {...Users} ,

           )}
          
      
        
        } 
        catch (error) {
           alert(error.response.data.msg)
        }
       }
    const state = useContext(GlobalState)
    const [User , setUser] = useState(initialeState)
    const [isAdmin] = state.UserApi.isAdmin
    const [onEdit , setOnEdit] = useState(false)
    const param = useParams() 
  return (
    <>

     <Spacing lg="150" md="80" />
      <Div className="container">
        <Div className="row">
    
          </Div>
          <Div className="col-lg-6">
            <form action="#" className="row" onSubmit={HandleSubmit} encType='multipart/form-data'>
              <Div className="col-sm-6">
                <label className="cs-primary_color">ID User</label>
                <input type="text" className="cs-form_field" name='poste_id'
                value={User._id} onChange={HandleChangeInput} disabled={onEdit} />
                <Spacing lg="20" md="20" />
              </Div>
              <Div className="col-sm-6">
                <label className="cs-primary_color">Username</label>
                <input type="text" className="cs-form_field" name='username'
                value={User.username} onChange={HandleChangeInput}/>
                <Spacing lg="20" md="20" />
              </Div>
              <Div className="col-sm-6">
                <label className="cs-primary_color">Email</label>
                <input type="text" className="cs-form_field" name='email'
                value={User.email} onChange={HandleChangeInput} />
                <Spacing lg="20" md="20" />
              </Div>
              <Div className="col-sm-6">
                <label className="cs-primary_color">Password</label>
                <input type="text" name='password' className="cs-form_field"
                value={User.password} onChange={HandleChangeInput} />
                <Spacing lg="20" md="20" />
              </Div>
              <Div className="col-sm-6">
                <label className="cs-primary_color">Role</label>
                <input type="text" name='role' className="cs-form_field"
                value={User.role} onChange={HandleChangeInput} />
                <Spacing lg="20" md="20" />
              </Div>
              <Spacing lg="25" md="25" />
              <Div className="col-sm-12">
                <button className="cs-btn cs-style1" type='submit'>
                  <span>Modifier</span>
                  <Icon icon="bi:arrow-right" />
                </button>
                <Spacing lg="25" md="25" />
                {onEdit ? 
                  <button className="cs-btn cs-style1" type='submit' >
                    <span>Supprimer</span>
                    <Icon icon="bi:arrow-right" />
                    </button> :''}

              </Div>
            </form>
          </Div>
        </Div>
      </>
  )
}

export default UpdateUser
